import '../App.css';

export function LocationFrame(props) {

    return (
        <div id={props.id}>
            <h3>{prop.sname}</h3>
            <img src={require(`../resources/WeatherIcons/sun.svg`)} alt='Weather icon' className='App-icon'/>
            <p>{props.temp}</p>

        </div>
    )
}
